import React, {Component} from 'react';
import Cart from './cart';
import ProductList from './productList';

class Shop extends Component {
  state = {
    cart:0
  };

  render () {
    return (
      <div>
        <Cart cart={this.state.cart}/>
        <ProductList cart={this.state.cart}/>
      </div>
    );
  }
}
